import React from "react";
import "../css/favoriteMenu.css";

import { MenuContent } from "../helper/MenuContent";

const Menu = ({ clickHandler }) => {
  return (
    <div>
      <div className=" favorite-page">
        <div className="container">
          <div className="container py-4 d-flex justify-content-evenly ">
            {MenuContent.map((content) => (
              <button
                onClick={clickHandler}
                name={content.name}
                className=" favoriteBtns  me-2 "
              >
                <img name="img" src={content.img} className="me-1" />
                {content.name}
              </button>
            ))}

            <button
              onClick={clickHandler}
              name="pizza"
              className="favoriteBtns me-2 "
            >
              <img name="img" src={pizza} className="me-1" />
              Pizza
            </button>

            <button
              onClick={clickHandler}
              name="burger"
              className="favoriteBtns  me-2 "
            >
              <img name="img" src={burger} className="me-1" />
              Burger
            </button>

            <button
              onClick={clickHandler}
              name="Kızartmalar"
              className="favoriteBtns  me-2 "
            >
              <img name="img" src={kızartma} className="me-1" />
              Kızartmalar
            </button>

            <button
              onClick={clickHandler}
              name="FastFood"
              className="favoriteBtns  me-2 "
            >
              <img name="img" src={fastfood} className="me-1" />
              Fast Food
            </button>

            <button
              onClick={clickHandler}
              name="gazlıIcecek"
              className="favoriteBtns  me-2 "
            >
              <img name="img" src={gazliIcecek} className="me-1" />
              Gazlı İcecek
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Menu;
